window.bookSummaryJSON = "<p><b>Audie Award Nominee, Science Fiction, 2013</b></p> <p></p> <p>Padlocked doors. Strange light fixtures. Mutant cockroaches. </p> <p>There are some odd things about Nate’s new apartment. Of course, he has other things on his mind. He hates his job. He has no money in the bank. No girlfriend. No plans for the future. So while his new home isn’t perfect, it’s livable. The rent is low, the property managers are friendly, and the odd little mysteries don’t nag at him too much. At least, not until he meets Mandy, his neighbor across the hall, and notices something unusual about her apartment. And Xela’s apartment. And Tim’s. And Veek’s. Because every room in this old Los Angeles brownstone has a mystery or two. Mysteries that stretch back over a hundred years. Some of them are in plain sight. Some are behind locked doors. And all together these mysteries could mean the end of Nate and his friends. Or the end of everything.... </p> <p>Padlocked doors. Strange light fixtures. Mutant cockroaches. </p> <p>There are some odd things about Nate’s new apartment. Of course, he has other things on his mind. He hates his job. He has no money in the bank. No girlfriend. No plans for the future. So while his new home isn’t perfect, it’s livable. The rent is low, the property managers are friendly, and the odd little mysteries don’t nag at him too much. At least, not until he meets Mandy, his neighbor across the hall, and notices something unusual about her apartment. And Xela’s apartment. And Tim’s. And Veek’s. Because every room in this old Los Angeles brownstone has a mystery or two. Mysteries that stretch back over a hundred years. Some of them are in plain sight. Some are behind locked doors. And all together these mysteries could mean the end of Nate and his friends. Or the end of everything.... </p>"; 
